(function() {

    angular.module("apilaApp").service("exportPdf", exportPdf);

    var imageData = "data:image/png;base64,";
    var blankImage = "data:image/png;base64,";

    exportPdf.$inject = ['$filter'];
    function exportPdf($filter) {

        var exportAppointments = function(name, printable, header) {
            var doc = new jsPDF('p','pt','letter');

            // positions the table
            margins = {
                top: 120,
                bottom: 5,
                left: 40,
                width: 22
            };

            doc.fromHTML(printable, margins.left, margins.top, {
                "width": margins.width
            },
            function(dispose) {
                doc.setFontSize(22);
                doc.text(40, 50, "List of appointments for: " + header.name);
                doc.text(40, 100, "Date: " + name);
                doc.save(name);
            }, margins);

        }

        var exportAppointmentDetail = function(name, data) {
            var doc = new jsPDF('p','pt','letter');

            doc.addImage(blankImage, 'JPEG', 15, 15, 580, 760);

            var currDate = new Date(data.appointment.time);

            var dateFilter = $filter('date');
            var filteredTime = dateFilter(currDate, 'h:mm a');
            var filteredDate = dateFilter(currDate, 'MMMM d, yyyy');

            doc.setFont("times");
            doc.setFontSize(12);
            doc.text(50, 156, "Resident Going:");
            doc.text(140, 156, data.appointment.residentGoing);
            doc.text(50, 173, "Reason:");
            doc.text(140, 173, data.appointment.reason);

            doc.text(50, 204, "Location:");
            doc.text(140, 204, data.appointment.locationName);
            doc.text(50, 221, "Location:");
            doc.text(140, 221, data.appointment.locationDoctor);
            doc.text(50, 238, "Transporting:");
            doc.text(140, 238, data.appointment.transportation);

            doc.text(430, 221, "Date:");
            doc.text(470, 221, filteredDate);
            doc.text(430, 238, "Time:");
            doc.text(470, 238, filteredTime);

            //we'll add comments here

            doc.save(name);


        }

        return {
            exportAppointments: exportAppointments,
            exportAppointmentDetail: exportAppointmentDetail
        };

    }

})();
